import emailjs from 'emailjs-com';

export const sendContactFormData = (data) =>{


    emailjs.sendForm('service_oelubx2', 'template_1xefs0a', data, 'xQ5PcMNu0l7_KcNZK')
      .then((result) => {
          console.log(result.text);
      }, (error) => {
          console.log(error.text);
      });
}
